import { useEffect, useState } from "react";
import './App.css';

function App() {



  const [tarjeta, setTarjeta] = useState([])


  useEffect(() => {
    fetch('http://localhost:8084/tarjetas/consultarTodas')
      .then((response) => response.json())
      .then((tarjeta) => {
       console.log(tarjeta)
       setTarjeta(tarjeta)
      });
  }, []);


  return (
    <div className="App">
      <header className="App-header">
      <div>
      <table border="1">
        <thead>
          <tr>
            <th>pan</th>
            <th>ntsrtjeta</th>
            <th>nombre</th>
          </tr>
        </thead>
        <tbody>
          {tarjeta.map(art => {
            return (
              <tr key={art.pan}>
                <td>{art.pan}</td>
                <td>{art.ntarjeta}</td>
                <td>{art.nombre}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
      </header>
    </div>
  );
}

export default App;
